import React from 'react'

import { dataFlastat } from '../data/data_Flastat';

import Flasmat from '../assets/IMG_2336.jpg';
import Flastor from '../assets/IMG_2334.jpg';
import Flasfic from '../assets/IMG_2335.jpg';
import Flasnot from '../assets/IMG_2337.jpg';
import Flasboo from '../assets/IMG_2338.jpg';
import Flasguy from '../assets/IMG_2339.jpg';
import Flakiss from '../assets/IMG_2340.jpg';
import Flasbot from '../assets/IMG_2341.jpg';
import Flaspig from '../assets/IMG_2342.jpg';
import Flastar from '../assets/IMG_2343.jpg';
import Flasdy from '../assets/IMG_2344.jpg';
import Flaboss from '../assets/IMG_2345.jpg';
import Flasbro from '../assets/IMG_2346.jpg';
import Flacher from '../assets/IMG_2347.jpg';
import Flasxix from '../assets/IMG_2348.jpg';
import Flasnape from '../assets/IMG_2349.jpg';
import Flastone from '../assets/IMG_2350.jpg';
import Flaseye from '../assets/IMG_2351.jpg';


import Animal from '../components/Animal';

import "../style/Home.css";

function Flastat() {

  return (
    <div className="main">
      <div className="box_1" >
        <h1 className="big-text">Flastat</h1>
        <h2 className="normal-text">From the lands of Flasnoun with a revoulting smell of death.</h2>
      </div>
      <div className="box_animals">
        { dataFlastat.map( data =>{
          return <Animal  name={data.name} image={data.image} description={data.description} />
        })}

      </div>
      <div className="box_end"></div>
    </div>
  )
}

export default Flastat
